import React from 'react';
import './App.css';


function App() {
  return (
    <div  className="App">
    <div id="container">
		<div id="header">
			<div id="logo">
				<h1>Product management</h1>
			</div>
			<div id="menu">
				<ul>
					<li>Homepage</li>
					<li>Suppliers</li>
					<li>Categories</li>
					<li>Products</li>			
				</ul>
			</div>
		</div>
		<div id="main">

		</div>
	</div>
    </div>
  );
}

export default App;
